      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + 36 - + col0 NOT IN ( + + col2 * - col1 + + 15 + + col1, col1 + + col1 * + col1 * col0 );
  - name: tab1

outputs:
  - name: q927.out
    data: |
      51	14	96
      85	5	59
      91	47	68
